use actix_web::{get, web, HttpResponse};
use actix_session::Session; #[get("/oauth2/authorize/{provider}")]
async fn authorize( provider: web::Path<String>, session: Session, clients: web::Data<OAuth2ClientRepository>,
) -> HttpResponse { let client = clients.get_client(&provider).unwrap(); // Generate authorization URL with PKCE and nonce let (auth_url, state, pkce_verifier, nonce) = client.authorization_url(); // Store state in session for CSRF protection session.insert("oauth2_state", state.secret()).unwrap(); // Store PKCE verifier for token exchange if let Some(verifier) = pkce_verifier { session.insert("oauth2_pkce", verifier.secret()).unwrap(); } // Store nonce for OIDC token validation if let Some(n) = nonce { session.insert("oauth2_nonce", n.secret()).unwrap(); } HttpResponse::Found() .append_header(("Location", auth_url.to_string())) .finish()
}

