use oauth2::{CsrfToken, PkceCodeVerifier};
use openidconnect::Nonce; #[derive(Deserialize)]
struct CallbackQuery { code: String, state: String,
} #[get("/oauth2/callback/{provider}")]
async fn callback( provider: web::Path<String>, query: web::Query<CallbackQuery>, session: Session, clients: web::Data<OAuth2ClientRepository>,
) -> HttpResponse { let client = clients.get_client(&provider).unwrap(); // Verify state (CSRF protection) let stored_state: String = session.get("oauth2_state").unwrap().unwrap(); if query.state != stored_state { return HttpResponse::BadRequest().body("Invalid state"); } // Retrieve PKCE verifier let pkce_verifier = session .get::<String>("oauth2_pkce") .unwrap() .map(|s| PkceCodeVerifier::new(s)); // Retrieve nonce for OIDC let nonce = session .get::<String>("oauth2_nonce") .unwrap() .map(|s| Nonce::new(s)); // Exchange code for tokens let (oauth2_user, oidc_user) = client .exchange_code(&query.code, pkce_verifier, nonce.as_ref()) .await .map_err(|e| HttpResponse::InternalServerError().body(e.to_string()))?; // Convert to authenticated user let user = oauth2_user.to_user(); // Store user in session session.insert("user", serde_json::to_string(&oauth2_user).unwrap()).unwrap(); HttpResponse::Found() .append_header(("Location", "/")) .finish()
}

