} impl Authorizer for OpaAuthorizer { fn authorize(&self, user: Option<&User>, req: &ServiceRequest) -> AuthorizationResult { let input = serde_json::json!({ "input": { "user": user.map(|u| &u.username), "roles": user.map(|u| &u.roles).unwrap_or(&HashSet::new()), "path": req.path(), "method": req.method().as_str(), } }); match self.client .post(&format!("{}/v1/data/authz/allow", self.opa_url)) .json(&input) .send() { Ok(resp) => { let result: serde_json::Value = resp.json().unwrap_or_default(); if result["result"].as_bool().unwrap_or(false) { AuthorizationResult::Granted } else if user.is_some() { AuthorizationResult::Denied } else { AuthorizationResult::LoginRequired } } Err(e) => { log::error!("OPA request failed: {}", e); AuthorizationResult::Denied // Fail closed } } }
}

