use actix_web::dev::ServiceRequest; #[derive(Clone)]
pub struct AbacAuthorizer { policy_engine: PolicyEngine,
} impl Authorizer for AbacAuthorizer { fn authorize(&self, user: Option<&User>, req: &ServiceRequest) -> AuthorizationResult { // Build policy context let context = PolicyContext { subject: user.map(|u| Subject { id: u.username.clone(), roles: u.roles.clone(), attributes: self.get_user_attributes(user), }), resource: Resource { path: req.path().to_string(), method: req.method().to_string(), }, environment: Environment { time: chrono::Utc::now(), ip: req.peer_addr().map(|a| a.ip()), }, }; // Evaluate policy match self.policy_engine.evaluate(&context) { PolicyDecision::Allow => AuthorizationResult::Granted, PolicyDecision::Deny => AuthorizationResult::Denied, PolicyDecision::NotApplicable => { if user.is_some() { AuthorizationResult::Denied } else { AuthorizationResult::LoginRequired } } } }
}

