// tests/common/mod.rs
use actix_security::http::security::{ AuthenticationManager, AuthorizationManager, Argon2PasswordEncoder, PasswordEncoder, User, Access,
};
use actix_security::http::security::web::{MemoryAuthenticator, RequestMatcherAuthorizer};
use base64::prelude::*; /// Create test authenticator with predefined users.
pub fn test_authenticator() -> MemoryAuthenticator { let encoder = Argon2PasswordEncoder::new(); AuthenticationManager::in_memory_authentication() .password_encoder(encoder.clone()) .with_user( User::with_encoded_password("admin", encoder.encode("admin")) .roles(&["ADMIN".into(), "USER".into()]) .authorities(&["users:read".into(), "users:write".into()]) ) .with_user( User::with_encoded_password("user", encoder.encode("user")) .roles(&["USER".into()]) .authorities(&["users:read".into()]) ) .with_user( User::with_encoded_password("guest", encoder.encode("guest")) .roles(&["GUEST".into()]) )
} /// Create test authorizer.
pub fn test_authorizer() -> RequestMatcherAuthorizer { AuthorizationManager::request_matcher() .login_url("/login") .http_basic() .add_matcher("/admin/.*", Access::new().roles(vec!["ADMIN"])) .add_matcher("/api/.*", Access::new().authenticated())
} /// Create Basic Auth header value.
pub fn basic_auth(username: &str, password: &str) -> String { let credentials = format!("{}:{}", username, password); format!("Basic {}", BASE64_STANDARD.encode(credentials))
}

