async fn login( form: web::Json<LoginRequest>, authenticator: web::Data<JwtAuthenticator>, users: web::Data<MemoryAuthenticator>,
) -> impl Responder { // Validate credentials let user = match users.find_user(&form.username) { Some(u) if encoder.matches(&form.password, u.get_password()) => u, _ => return HttpResponse::Unauthorized().body("Invalid credentials"), }; // Generate token match authenticator.generate_token(&user) { Ok(token) => HttpResponse::Ok().json(LoginResponse { access_token: token, token_type: "Bearer".to_string(), expires_in: 3600, }), Err(_) => HttpResponse::InternalServerError().body("Token generation failed"), }
}

