use actix_security::secured;
use actix_security::http::security::AuthenticatedUser; #[secured("USER")]
#[get("/api/profile")]
async fn profile(user: AuthenticatedUser) -> impl Responder { HttpResponse::Ok().json(serde_json::json!({ "username": user.get_username(), "roles": user.get_roles(), }))
